import React, { useState } from "react";
import styled from "styled-components";
import { Link } from "react-router-dom";
import Data from "../data";
import { TodoContext } from "../Context/AgentsContext";

const Container = styled.div`
  display: flex;
  flex-wrap: wrap;
  width: 90%;
  margin: 25px auto;
  .teamCard {
    border-radius: 15px;
    width: 204px;
    margin: 5px auto;
    margin-bottom: 25px;
    background: white;
    box-shadow: 8px 8px 4px #ccac08, -8px -8px 4px #eec006;
    p {
      margin: 10px;
    }
    .teamCard__img {
      width: 200px;
      height: 200px;
      padding: 10px;
      border-radius: 15px;
      object-fit: cover;
    }
  }
`;

const data = Data;

function SupportTeam() {
  return (
    <Container>
      {data.map((agent) => {
        return (
          <Link to={`/agents/${agent.id}`}>
            <div className="teamCard" id={Date.now}>
              <div className="userCard__userImage">
                <img
                  src={agent.src}
                  alt="agent profile"
                  height="200"
                  className="teamCard__img"
                />
              </div>
              <div>
                <p>{agent.name}</p>
                <p>{agent.title}</p>
              </div>
            </div>
          </Link>
        );
      })}
    </Container>
  );
}

export default SupportTeam;
